window.bookSummaryJSON = "<p>The Rift opens once again.&nbsp;&nbsp;</p> <p>The battle for Earth continues.&nbsp;&nbsp;</p> <p>Only the <i>Eureka </i>and her crew can turn the tides.&nbsp;&nbsp;&nbsp;</p> <p>The <i>Eureka </i>returns to Sol through the Rift as an extreme time dilation creates complications. With a familiar face now the Earth Fleet’s Grand Admiral, Ace and the others struggle to acclimate to their new reality.&nbsp;&nbsp;&nbsp;</p> <p>When one of the heroes is captured by the Watchers, the others plan a rescue that hinges on the success of the entire war. To end the 30-year endeavor, the Fleet must align with a longstanding enemy, but knowing who to trust isn’t so simple.&nbsp;&nbsp;&nbsp;</p> <p>Join the crew of the <i>Eureka </i>as they fight to save Earth and its inhabitants in the epic third part of the Resistance series.</p>"; 
